import Link from 'next/link'
import Head from 'next/head'
import {HeaderTemplate} from '../templates/header'
//import styles from '../styles/header.css'

export default function Index() {
	return(<HeaderTemplate>
	<style jsx>{`
        .slider_arrow {
	width: 36px;
	height: 36px;
	background: #E7E7E7;
	position: absolute;
	border-radius: 100%;
	z-index: 1;
	top: 225px;
}

.slider_arrow::before {
	content: '';
	position: absolute;
	width: 10px;
	height: 10px;
	border-bottom: 1px solid #1E1D1D;
	border-left: 1px solid #1E1D1D;
	top: 50%;
	left: 50%;
}

.previous_arrow::before {
	transform: translate(-20%, -50%) rotate(45deg);
}

.next_arrow::before {
	transform: translate(-70%, -50%) rotate(225deg);
}

.previous_arrow {
	left: 3px;
}

.next_arrow {
	right: 3px;
}

/*banner start*/
.main_banner {
	width: 100%;
	display: flex;
	flex-wrap: wrap;
	height: 100vh;
	color: var(--main_black);
}

.main_banner .banner_block {
	width: 50%;
	height: 100%;
	background-size: cover;
	background-repeat: no-repeat;
	padding-left: 61px;
	padding-right: 61px;
	padding-bottom: 62px;
	display: flex;
	flex-direction: column;
	justify-content: flex-end;
	align-items: flex-start
}

.main_banner a {
	width: 84px;
	height: 34px;
	display: flex;
	align-items: center;
	justify-content: center;
	border-radius: 29px;
}

.main_banner h2 {
	font-size: 36px;
	line-height: 1.7;
	margin-bottom: 53px;
	text-transform: uppercase;
}

.main_banner a:hover {
	background-color: #fff;
}

/*banner end*/

/*collections start*/
.main_collections {
	padding-top: 140px;
	padding-bottom: 100px;
	color: var(--main_black);
}

.main_collections .top_bar {
	padding-bottom: 60px;
	display: flex;
	justify-content: space-between;
}

.main_collections .navigation {
	display: flex;
	border-bottom: 1px solid #D7D7D7;
}

.main_collections .navigation p {
	margin-left: 22px;
	margin-right: 22px;
	padding-bottom: 7px;
	font-size: 16px;
	line-height: 169.4%;
}

.main_collections .navigation p.active {
	font-weight: 700;
	border-bottom: 1px solid #1E1D1D;
}

.main_collections .navigation p:first-child {
	margin-left: 0;
}

.main_collections .navigation p:last-child {
	margin-right: 0;
}

.main_collections .changer {
	display: flex;
}

.main_collections .changer .prev svg {
	transform: rotate(180deg);
}

.main_collections .changer > span {
	padding-left: 14px;
	padding-right: 14px;
	font-weight: 500;
	transition: all .4s ease-in-out;
}

.main_collections .single_product {
	background: #FFFFFF;
	box-shadow: 0px 3px 30px rgba(216, 216, 216, 0.5);
	border-radius: 20px;
	overflow: hidden;
	margin-right: 22px;
	margin-left: 22px;
	margin-bottom: 40px;
}

.main_collections img {
	display: block;
	width: 100%;
	object-fit: cover;
	height: 485px;
	margin-bottom: 30px;
}

.main_collections h4 {
	font-weight: bold;
	font-size: 20px;
	line-height: 169.4%;
	margin-bottom: 10px;
	text-transform: uppercase;
	width: 100%;
}

.main_collections .product_description {
	padding-left: 20px;
	padding-right: 20px;
	padding-bottom: 30px;
